// src/App.js
import React from 'react';
import { BrowserRouter as Router, Routes, Route, Link } from 'react-router-dom';
import TeacherUpload from './components/TeacherUpload';
import TeacherStudents from './components/TeacherStudents';
import StudentDetails from './components/StudentDetails';

function App() {
  return (
    <Router>
      <div>
        <nav>
          <ul>
            <li><Link to="/teacher/upload">Teacher Upload</Link></li>
            <li><Link to="/teacher/students">Teacher View Students</Link></li>
            <li><Link to="/student/12345">Student Details</Link></li>
          </ul>
        </nav>
        <Routes>
          <Route path="/teacher/upload" element={<TeacherUpload />} />
          <Route path="/teacher/students" element={<TeacherStudents />} />
          <Route path="/:id/exam" element={<StudentDetails />} />
        </Routes>
      </div>
    </Router>
  );
}

export default App;
